import { defineStore } from 'pinia'

export const useTodoStore = defineStore('todo', {
    state: () => ({ count: 4, name: 'Eduardo' }),
    getters: {
      doubleCount: (state) => state.count * 2,
    },
    actions: {
      increment() {
        this.count++
      },
    },
})
